export default function ProductionPlanning() {
  return (
    <Tabs defaultActiveKey="profile">
      <Tab eventKey="home" title="Home">
        <Sonnet />
      </Tab>
      <Tab eventKey="profile" title="Profile">
        <Sonnet />
      </Tab>
      <Tab eventKey="contact" title="Contact">
        <Sonnet />
      </Tab>
    </Tabs>
  );
}
